Vox's **Future Perfect** spotlights long-term thinking and evidence-based strategies for improving human and animal welfare. Each year, its writers [forecast](https://www.vox.com/future-perfect/2024/1/1/24011179/2024-predictions-trump-politics-ohtani-oppenheimer-elections) the coming year and assess their previous [predictions](https://www.vox.com/future-perfect/24006533/2023-predictions-revisited-trump-biden-politics).

#### This year, Metaculus is collaborating with Future Perfect on their 2025 forecasts.&#x20;

On January 1st, they will publish their predictions on the questions below. You can join them — forecast alongside journalists like [Dylan Matthews](https://x.com/dylanmatt?ref_src=twsrc%5Egoogle%7Ctwcamp%5Eserp%7Ctwgr%5Eauthor), [Kelsey Piper](https://x.com/KelseyTuoc?ref_src=twsrc%5Egoogle%7Ctwcamp%5Eserp%7Ctwgr%5Eauthor), [Sigal Samuel](https://x.com/SigalSamuel?ref_src=twsrc%5Egoogle%7Ctwcamp%5Eserp%7Ctwgr%5Eauthor), see your aggregated predictions appear on Vox.com January 1st, and compete for the $2,500 prize pool.

#### **Prize Pool —  $2,500**

*Find additional information on this tournament and share feedback* [*here*](https://www.metaculus.com/notebooks/31137/forecast-2025-with-voxs-future-perfect-team/)*.*&#x20;

***

*Communities like this one are a new Metaculus feature that lets anyone create and share forecasting questions on topics they care about. Communities can be publicly listed or kept unlisted. This one was co-created by Future Perfect and Metaculus.*&#x20;

*Interested in creating your own Community?* [*Reach out*](mailto:christian@metaculus.com) *to us, or* [*explore*](https://www.metaculus.com/questions/?communities=true) *existing publicly listed communities.*

